import io.nash.openlimits.*;

public class Example {

    public static void main(String[] args) {
        String secret = "";
        String apiKey = "0570d053-36fd-41a9-bf1a-7a9be102dc83";
        NashConfig config = new NashConfig(
                new NashCredentials(secret, apiKey),
                0,
                "sandbox",
                10000
        );
        ExchangeClient client = new ExchangeClient(new ExchangeClientConfig(config));
        LimitRequest request = LimitRequest.goodTillCancelled(
                "5.0",
                "1.0",
                "eth_btc"
        );
        int i = 0;
        while (true) {
            System.out.println(i++);
            System.out.println(client.limitBuy(request));
            System.out.println(client.cancelAllOrders(new CancelAllOrdersRequest("eth_btc")));
        }
    }
}